import { Helmet } from 'react-helmet';
import CocktailsDataService from "../../services/cocktails.js"

import { Title, Wrapper } from './home.style'

const randomize = () => {
    const rand = Math.floor((Math.random() * 100)) 
    return rand;
}

const Home = () => {
    const [cocktails, setCocktails] = useState([]);

    useEffect(() => {
        CocktailsDataService.find(5, "Nums")
    })

    return (
        <div className="App">
            <Helmet>
                <style>{'body {background-color: orange; }'}</style>
            </Helmet>
            <Wrapper>
                <Title>
                    Cocktail of the Day                
                </Title>
                {cocktails.map((cocktail) => {
                        return (
                            <p>{cocktail.Cocktail}</p>
                        )
                    })}
            </Wrapper>
                <div>

                </div>

        </div>

    )

}

export default Home;
